import React from "react";
import styled from "styled-components";

const Main = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
`;

const Div = styled.div``;

const Home = () => {
  return (
    <Main>
      <Div>
        <h5>HOME</h5>
        <button>log out</button>
      </Div>
    </Main>
  );
};

export default Home;
